// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.16;

import "./IERC5192.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract SoulManager is Ownable, ERC1155 {
    struct SoulToken {
        bytes32 soulKey;
        uint mintTimeStamp;
        uint burnTimeStamp;
    }

    struct Soul {
        address soulOwner;
        uint8 index;
        uint256 nonce;
    }
    //Soul
    mapping (address => mapping(uint8 => mapping(uint256 => SoulToken))) soulTokens; // publicKey -> (soul)index -> tokenID -> tokenInfo
    mapping (address => bytes32[]) souls; // soulKey
    mapping (bytes32 => uint8) soulIndex; // soulKey index 
    mapping (bytes32 => address) soulOwners; // soulkey  address
    mapping (address => mapping(uint8 => bool)) soulIndexCheck; //
    mapping (address => uint256) nonce;


    string name;
    uint8 size;

    event Create(address owner, uint8 size); // SoulCreate
    event Delete(address owner, uint8 index); // SoulDelete
    event Mint(address owner, uint8 index, uint256 tokenID); // TokenID 
    event Burn(address owner, uint8 index, uint256 tokenID); //TokenID  Token 
    event Burn(address owner, address to, uint256 tokenID);  //  Token 

    //Token
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    mapping(uint256 => mapping(address => bool)) _locked;
    mapping(uint256 => address) tokenOwnerOf;

    event Locked(address soulOwner, uint256 tokenId);
    event Unlocked(address soulOnwer, uint256 tokenId);
    event MintPublicChain(address soulOwner, uint256 tokenId);
    event BurnPublicChain(address soulOwner, uint256 tokenId);
    event CreateToken(address tokenOwner, uint256 tokenId);

    function locked(address soulOwner, uint256 tokenId) external view returns (bool) {
        return _locked[tokenId][soulOwner];
    }

    constructor(string memory _name, uint8 _size, string memory uri) ERC1155(uri) {
        name = _name; // Contract 
        size = _size; // Soul 
    }

    function createSoul(address soulOwner) external onlyOwner {
        uint8 index = getEmptySoulIndex(soulOwner);

        require(index < size, "Soul Size Exception");

        bytes32 soulKey = keccak256(abi.encode(Soul(soulOwner, index, getNonce(soulOwner))));
        souls[soulOwner].push(soulKey);

        soulIndex[soulKey] = index;
        soulOwners[soulKey] = soulOwner;
        setSoulIndex(soulOwner, index, true);

        emit Create(soulOwner, soulIndex[soulKey]);
    }

    function deleteSoul(address soulOwner, uint8 arrayIndex) external onlyOwner {
        uint256 length = souls[soulOwner].length;
        require(length > 1, "Must have Soul");
        require(arrayIndex < length, "Array Index Exception");

        bytes32 soulKey = souls[soulOwner][arrayIndex];
        uint8 index = soulIndex[soulKey];

        setSoulIndex(soulOwner, index, false);
        delete soulOwners[soulKey];
        delete soulIndex[soulKey];

        souls[soulOwner][arrayIndex] = souls[soulOwner][length - 1];
        souls[soulOwner].pop();

        emit Delete(soulOwner, index);
    }

    function mintSoulToken(address tokenOwner, address to, uint8 arrayIndex, uint256 tokenId) external onlyOwner {
        require(tokenOwnerOf[tokenId] == tokenOwner, "is not Token Owner");

        bytes32 soulKey = souls[to][arrayIndex];
        uint8 index = soulIndex[soulKey];

        require(soulKey != bytes32(0), "not have Soul");

        require(soulTokens[to][index][tokenId].soulKey != soulKey  ||
            (soulTokens[to][index][tokenId].soulKey == soulKey && soulTokens[to][index][tokenId].burnTimeStamp != 0)
        , "Already has token");

        soulTokens[to][index][tokenId] = SoulToken(soulKey, block.timestamp, 0);
    }

    function burnSoulToken(address tokenOwner, address to, uint256 tokenId) external {
        require(tokenOwnerOf[tokenId] == tokenOwner, "is not Token Owner");

        uint length = souls[to].length;
        require(length > 0, "not have Soul");

        for(uint8 i = 0; i < length; ++i) {

            bytes32 soulKey = soulTokens[to][i][tokenId].soulKey;
            address soulOwner = soulOwners[soulKey];
            if(soulOwner != to) {
                continue;
            }

            soulTokens[to][i][tokenId].burnTimeStamp = block.timestamp;
        }

        emit Burn(tokenOwner, to, tokenId);
    }

    function deleteSoulToken(address soulOwner, uint8 arrayIndex, uint256 tokenId) external {
        bytes32 soulKey = souls[soulOwner][arrayIndex];
        uint8 index = soulIndex[soulKey];

        delete soulTokens[soulOwner][index][tokenId];

        emit Burn(soulOwner, index, tokenId);
    }

    function mintTokenPublicChain(address soulOwner, uint8 arrayIndex, uint256 tokenID) external {
        require(!_locked[tokenID][soulOwner], "already has token in public chain");

        bytes32 soulKey = souls[soulOwner][arrayIndex];
        uint8 index = soulIndex[soulKey];

        require(soulTokens[soulOwner][index][tokenID].soulKey == soulKey, "Token is not mine");

        //Mint ERC1155
        _mint(soulOwner, tokenID, 1, "");
        emit MintPublicChain(soulOwner, tokenID);

        _locked[tokenID][soulOwner] =  true;
        emit Locked(soulOwner, tokenID);
    }

    function burnTokenPublicChain(address soulOwner, uint8 arrayIndex, uint256 tokenID) external {
        require(_locked[tokenID][soulOwner], "not has token in public chain");

        bytes32 soulKey = souls[soulOwner][arrayIndex];
        uint8 index = soulIndex[soulKey];

        require(soulTokens[soulOwner][index][tokenID].soulKey == soulKey, "Token is not mine");

        _locked[tokenID][soulOwner] =  false;
        emit Unlocked(soulOwner, tokenID);

        //burn ERC1155
        _burn(soulOwner, tokenID, 1);
        emit BurnPublicChain(soulOwner, tokenID);
    }

    function createToken(address tokenOwner) external {
        _tokenIdCounter.increment();

        uint256 newTokenId = _tokenIdCounter.current();
        tokenOwnerOf[newTokenId] = tokenOwner;

        _mint(tokenOwner, newTokenId, 1, "");
        emit CreateToken(tokenOwner, newTokenId);

        _locked[newTokenId][tokenOwner] =  true;
        emit Locked(tokenOwner, newTokenId);
    }

    function getEmptySoulIndex(address soulOwner) private view returns(uint8) {
        uint8 output = size;

        for(uint8 i = 0; i < size; ++i) {
            if(!soulIndexCheck[soulOwner][i]) {
                output = i;
                break;
            }
        }

        return output;
    }
    function setSoulIndex(address soulOwner, uint8 index, bool isFill) private {
        soulIndexCheck[soulOwner][index] = isFill;
    }

    function getNonce(address soulOwner) private returns(uint256) {
        nonce[soulOwner] += 1;
        return nonce[soulOwner];
    }

    function getSouls(address soulOwner) external view returns(bytes32[] memory) {
        return souls[soulOwner];
    }

    function getToken(address soulOwner, uint8 arrayIndex, uint256 tokenId) external view returns(SoulToken memory) {
        bytes32 soulKey = souls[soulOwner][arrayIndex];
        uint8 index = soulIndex[soulKey];

        SoulToken memory token = soulTokens[soulOwner][index][tokenId];

        require(token.soulKey == soulKey, "not have token");

        return token;
    }

    //Transfer, Batch 
    modifier IsTransferAllowed(address soulOwner, uint256 tokenId) {
        require(!_locked[tokenId][soulOwner]);
        _;
    }

    function _burnBatch(
        address from,
        uint256[] memory ids,
        uint256[] memory amounts
    ) internal virtual override(ERC1155) {}

    function _mintBatch(
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override(ERC1155) {
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) public virtual override (ERC1155) IsTransferAllowed(from, id) {
        super.safeTransferFrom(from, to, id, amount, data);
    }

    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) public virtual override (ERC1155) {}

    function _safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) internal virtual override(ERC1155) IsTransferAllowed(from, id) {
        super._safeTransferFrom(from, to, id, amount, data);
    }

    function _safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override(ERC1155) {}

    function _beforeTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override(ERC1155) {}

    function _afterTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override(ERC1155) {}


}
